import React, {useState, useEffect} from 'react';
import classes from '../../../CSS/GameStyle.module.css'
const InputPad = () =>{
    return(
        <div classname={classes.Padstyle} >
            <ul classname={classes.Padstyle}>
                <li></li>
            </ul>
        </div>
    )
}
export default InputPad;
